Accounts_CustomFields_Description:
Pêdivî ye ku JSON derbasdar e ku kûreyên navên nav hene ku di nav deverên peldankê hene. Nimûne: <br/><code>{
"rola": {
"type": "select"
"defaultValue": "xwendekaran"
"alternatîf": ["mamoste", "xwendekaran"],
"pêwîst": rast,
"ModifyRecordField": {
"array": rast,
"qada": "roles"
}
},
"twitter": {
"type": "text"
"pêwîst": rast,
"minLength": 2,
"maxLength": 10
}
}</code>

Custom_Translations_Description:
Divê JSON ê ku derheq in ku zimanên ku bi zimanê key-ê û wergeran tê wergerandin divê derbasdar e. Nimûne:<br/><code>{
"en": {
"Channels": "Rooms"
},
"pt": {
"Channels": "Salas"
}
}</code>
